  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Canaan
  Valley National Wildlife Refuge highlights Refuge accomplishments during the 2012
  fiscal year. The report begins with a summary of the year's highlights. Land acquisition
  is covered. Refuge administration is outlined; information about funding is given.
  Habitat management is also covered; subjects include forests, grasslands, and pest
  control. The wildlife section of the report discusses wildlife inventories, endangered
  and threatened species, fisheries resources, and marking and bird banding. The public
  uses of the Refuge described in this report include interpretive programs, hunting,
  and outdoor recreation.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
